import "./App.css";
import { Link } from "react-router-dom";
import React, { Component } from "react";

class App extends Component {
  render() {
    return (
      <div className="container margin-top">
        <div className="row">
          <div className="col-sm-12 text-center bacground-div">
            <Link to="/">
              <h1>Job search bar</h1>
            </Link>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
